import style  from "./crud.module.css"
import axios from "axios"
import { useEffect, useState } from "react"
const Users=()=>{
    let [user,setUser]=useState([])
    useEffect(()=>{
        axios.get("http://localhost:3004/employees")
        .then((response)=>{setUser(response.data)})
        .catch(()=>{console.log("error");})
    })
    return(
       
        <div id={style.user}>
            <div id={style.heading}>
             <h1 >NAME</h1>
             <h1 >SALARY</h1>
             <h1 >COMPANY</h1>
             <br/><br/>
             </div>
             <div id={style.gotele}>
            {user.map((detail)=>{
               return(
            <div> 
               <h2 id={style.first_h2} key={detail.id}>{detail.empName}</h2>
               <h2 key={detail.id}>{detail.empSalary}</h2>
               <h2 key={detail.id}>{detail.empCompany}</h2>
            </div>)
            })}
            
            </div>


        </div>
    )
}
export default Users
